import React from "react";
import { Navigate, useParams } from "react-router-dom";

import "./Item.css";

const Item = ({items}) => {
  let {id} = useParams();
  const item = items.find((item) => item.id === itemId);
  if (item === undefined) {
    return <Navigate to="/"/>
  }
  return (
    <div>
      <h1>Rendering item page</h1>
    </div>
  );
};

export default Item;
